// RecipeList.jsx

import React from 'react';

const RecipeList = ({ recipes }) => {
    return (
        <div className="recipe-list">
            {recipes.map(recipe => (
                <div key={recipe.id}>
                    <h3>{recipe.name}</h3>
                    <p>Ingredients: {recipe.ingredients}</p>
                    <p>Calories: {recipe.calories}</p>
                    <p>Instructions: {recipe.instructions}</p>
                </div>
            ))}
        </div>
    );
}

export default RecipeList;
